import React from 'react';

const columns = [
  {
    title: 'Name',
    dataIndex: 'name', 
    render: (text) => <a>{text}</a>,
  },
  {
    title: 'STT',
    dataIndex: 'stt',
  },
  {
    title: 'Date',
    dataIndex: 'date',
  },
  {
    title: 'Customer',
    dataIndex: 'customer',
  },
  {
    title: 'Name Product',
    dataIndex: 'nameProduct',
  },
  {
    title: 'Quantity',
    dataIndex: 'quantity',
  },
  {
    title: 'Phone Customer',
    dataIndex: 'phone customer',
  },
  {
    title: 'Adress',
    dataIndex: 'adress',
  },
  {
    title: 'Price',
    dataIndex: 'price',
  },
  {
    title: 'Total',
    dataIndex: 'total',
  },
];

export default columns;
